import React from 'react';
//import logo from './logo.svg';
import img from './assets/img/Scarecrow.png';
import './App.css';

function App(prop) {
  return (
    <div className="App">
      <header className="App-header">
        <img src={img} className="App-logo" alt="logo" />
        <p>
          {prop.massage}
        </p>

      </header>
    </div>
  );
}

export default App;
